import React from "react";
import { Routes, Route } from "react-router-dom";
import Login from "./pages/Login";
import Admin from "./admin/Admin";
import ProtectedRoute from "./pages/ProtectedRoute";
import Dashboard from "./admin/Dashboard";
import Mhs from "./admin/Mhs";
import Dosen from "./admin/Dosen"; // pastikan import ini
import Matkul from "./admin/Matkul"; // jika sudah ada
import Mahasiswa from "./Mahasiswa/Mahasiswa";
import DetailMahasiswa from "./admin/DetailMahasiswa";

const App = () => {
  return (
    <Routes>
      {/* Public Routes */}
      <Route path="/" element={<Login />} />
      <Route path="/Login" element={<Login />} />
      <Route path="/Mahasiswa/Mahasiswa" element={<Mahasiswa />} />
      <Route path="/Admin/Mahasiswa/DetailMahasiswa" element={<DetailMahasiswa />} />

      {/* Protected Admin Routes with Layout */}
      <Route
        path="/Admin"
        element={
          <ProtectedRoute>
            <Admin /> {/* Ini adalah layout yg memuat Sidebar/Header */}
          </ProtectedRoute>
        }
      >
        <Route path="Dashboard" element={<Dashboard />} />
        <Route path="Mhs" element={<Mhs />} />
        <Route path="Dosen" element={<Dosen />} />
        <Route path="Matkul" element={<Matkul />} /> {/* jika sudah ada */}
      </Route>
    </Routes>
  );
};

export default App;
